Field_Binary.description:
SNT measurement flag.
   0 = SNT value is the predicted value; 
   1 = SNT value is the measured value

Polarity of the correlation reference relative to what was transmitted.; 
   0 = Not inverted; 
   1 = Inverted

Correlation type.
   0 = Square wave; 
   1 = Sine wave

Operation #1. Logical operation between the accumulated pattern and the next subcode.
   0 = AND; 
   1 = OR; 
   2 = XOR; 
   3 = Weighted Vote, weight = 1; 
   4 = Weighted Vote, weight = 2; 
   5 = Weighted Vote, weight = 3; 
   6 = Weighted Vote, weight = 4; 
   7 = Weighted Vote, weight = 5; 
   8 = Weighted Vote, weight = 6

Operation #2. Logical operation between the accumulated pattern and the next subcode.
0 = AND; 
1 = OR; 
2 = XOR; 
3 = Weighted Vote, weight = 1; 
4 = Weighted Vote, weight = 2; 
5 = Weighted Vote, weight = 3; 
6 = Weighted Vote, weight = 4; 
7 = Weighted Vote, weight = 5; 
8 = Weighted Vote, weight = 6

