Metrics validity flag.
Validity of the Range Residual (rng_resid, field 10) and DRVID (drvid, field 11) measurements.
   0 = Invalid (No uplink data available); 
   1 = Invalid (Other reasons); 
   2 = Valid

Correlation validity flag.
0 = Invalid; 
1 = Valid

Range residual tolerance flag.
   0 = Out of  tolerance; 
   1 = In tolerance

DRVID tolerance flag.
   0 = Out of  tolerance; 
   1 = In tolerance

Pr/N0 residual tolerance flag.
   0 = Out of  tolerance; 
   1 = In tolerance

Range sigma tolerance flag.
   0 = Out of  tolerance; 
   1 = In tolerance

Range validity flag.
   0 = Invalid; 
   1 = Valid

Range configuration change flag.
   0 = Changed;
   1 = Unchanged

Ranging hardware status flag.
   0 = Bad; 
   1 = Good

Type of PN range measurement.
   0 = Ranging Round Trip; 
   1 = Calibration; 
   2 = Telemetry-Based Ranging; 
   3 = 1-way to Spacecraft; 
   4 = 1-way from Spacecraft; 
   5 = Coupled Noncoherent

Time tag correction flag -- indicates results of validation of the block time tag.
   0 = No validation attempted; 
   1 = Validated, no change; 
   2 = Validated, changed

Type of time tag correction flag -- indicates what type of time tag correction was made.
   0 = No correction; 
   1 = Year correction; 
   2 = DOY correction; 
   3 = Both Year and DOY correction

Doppler mode correction flag -- indicates the results of the validation of the Doppler mode.
   0 = Not applicable or no validation attempted; 
   1 = Validated, no change; 
   2 = Validated, changed

Uplink station correction flag -- indicates the results of the validation of the uplink station.
   0 = Not applicable or no validation attempted; 
   1 = Validated, no change; 
   2 = Validated, changed

Station calibration correction flag -- indicates result of validation of station calibration values.
   0 = Unable to correct; 
   1 = Validated, no change; 
   2 = Validated, changed ul_stn_cal; 
   3 = Validated, changed dl_stn_cal; 
   4 = Validated, changed both ul_stn_cal and dl_stn_cal; 
   5 = Validated, changed round-trip stn_cal

